<script>
// Import Swiper Vue.js components
import { Swiper, SwiperSlide } from "swiper/vue";
import { Autoplay, Pagination, Navigation } from "swiper";
import "swiper/css";
import "swiper/css/pagination";
import "swiper/css/navigation";

import { nextTick } from "process";

export default {
  components: {
    Swiper,
    SwiperSlide,
  },
  async setup() {
    const runtimeConfig = useRuntimeConfig();

    // получим список каталогов
    const { data: catalogs } = await useAsyncData("catalogs-main", () =>
      $fetch(runtimeConfig.public.API_URL + "catalog/")
    );
    // получим список акции
    const { data: promotions } = await useAsyncData(() =>
      $fetch(runtimeConfig.public.API_URL + "promotion/")
    );
    const catalogListElements = ref([]);
    const modalContactUs = ref(false);
    const showContactUs = () => {
      modalContactUs.value = true;
    };
    const deviceCatalogSlide = ref(0);
    // при изменении слайда получим id каталогс и скроллим список каталогов
    const slideChange = (swiper) => {
      deviceCatalogSlide.value = Number(
        swiper.slides[swiper.activeIndex].children[2].innerHTML
      );
      scrollToTargetElement(deviceCatalogSlide.value);
    };

    // функци для скролла список каталогов
    const scrollToTargetElement = (index) => {
      nextTick(() => {
        catalogListElements.value.forEach((catalogItem) => {
          catalogItem.classList.remove("catalog-elem-active");
        });
        // catalogListElements.value[index].classList.remove("catalog-elem-active");
        catalogListElements.value[index].classList.add("catalog-elem-active");
        catalogListElements.value[index].scrollIntoView({
          behavior: "smooth",
          block: "nearest",
          inline: "start",
        });
      });
    };

    const selectedTypeId = ref(0);

    const setSelectedType = (index) => {
      selectedTypeId.value = index;
    };
    // создадим ссылку для каталогов
    const setCatalogRef = (el) => {
      if (el) {
        catalogListElements.value.push(el);
      }
    };
    onBeforeUpdate(() => {
      catalogListElements.value = [];
    });
    return {
      modules: [Autoplay, Pagination, Navigation],
      catalogSwiperModules: [Pagination, Navigation],
      modalContactUs,
      showContactUs,
      catalogs,
      deviceCatalogSlide,
      slideChange,
      runtimeConfig,
      scrollToTargetElement,
      catalogListElements,
      setCatalogRef,
      promotions,
      setSelectedType,
      selectedTypeId,
    };
  },
};
</script>
